const canvas = document.getElementById('canvas');
const gridGroup = document.getElementById('gridGroup');
const overlay = document.getElementById('overlay');
const levelInput = document.getElementById('levelAdjust');
const W = 1200, H = 800;
let scale = 1.0;
let panX = 0, panY = 0;
const labelThresholdPx = 30;

// 기본 Z값 범위 저장
const baseZMin = -269;
const baseZMax = 259;
let currentZAdjust = 0;

function getColorForValue(t) {
    const hue = (1-t) * 240;
    return `hsl(${hue},100%,50%)`;
}

function updateZRange() {
    const adj = parseFloat(levelInput.value) || 0;
    const newMin = baseZMin + adj;
    const newMax = baseZMax + adj;
    document.getElementById('zRange').textContent = `${newMin.toFixed(1)} ~ ${newMax.toFixed(1)} mm`;
    document.getElementById('legendMin').textContent = `${newMin.toFixed(1)} mm`;
    document.getElementById('legendMax').textContent = `${newMax.toFixed(1)} mm`;
}

function adjustedLabel(baseZ) {
    const adj = parseFloat(levelInput.value) || 0;
    return (baseZ + adj).toFixed(3);
}

function renderCells() {
    const frag = document.createDocumentFragment();
    for (let i=0;i<items.length;i++) {
        const it = items[i];
        const rect = document.createElementNS("http://www.w3.org/2000/svg", "rect");
        rect.setAttribute("x", it.px);
        rect.setAttribute("y", it.py);
        rect.setAttribute("width", it.w);
        rect.setAttribute("height", it.h);
        rect.setAttribute("class", "cell");
        rect.setAttribute("fill", getColorForValue(it.t));
        frag.appendChild(rect);
    }
    gridGroup.appendChild(frag);
    updateTransform();
    updateLabels();
}

function updateTransform() {
    gridGroup.setAttribute("transform", `translate(${panX},${panY}) scale(${scale})`);
}

function updateLabels() {
    while (overlay.firstChild) overlay.removeChild(overlay.firstChild);
    const viewL = -panX/scale, viewT = -panY/scale;
    const viewR = (W-panX)/scale, viewB = (H-panY)/scale;
    
    for (let i=0;i<items.length;i++) {
        const it = items[i];
        const tx = it.px * scale + panX;
        const ty = it.py * scale + panY;
        const tw = it.w * scale;
        const th = it.h * scale;
        if (tx + tw < 0 || tx > W || ty + th < 0 || ty > H) continue;
        if (Math.min(tw, th) < labelThresholdPx) continue;
        
        const txCenter = it.cx * scale + panX;
        const tyCenter = it.cy * scale + panY;
        const txt = document.createElementNS("http://www.w3.org/2000/svg", "text");
        txt.setAttribute("x", txCenter.toFixed(2));
        txt.setAttribute("y", tyCenter.toFixed(2));
        txt.setAttribute("text-anchor", "middle");
        txt.setAttribute("dominant-baseline", "middle");
        txt.setAttribute("font-size", Math.min(16, Math.floor(Math.min(tw, th) * 0.25)));
        txt.setAttribute("fill", it.t > 0.5 ? "#fff" : "#000");
        const baseZ = parseFloat(it.label);
        txt.textContent = adjustedLabel(baseZ);
        overlay.appendChild(txt);
    }
}

// 레벨 조정 이벤트 핸들러
levelInput.addEventListener('input', () => {
    updateZRange();
    updateLabels();
});

// ... 기존 마우스/터치 이벤트 핸들러 코드 ...
let isPanning = false, startX=0, startY=0;
canvas.addEventListener('mousedown', (ev) => {
  isPanning = true; startX = ev.clientX; startY = ev.clientY;
  ev.preventDefault();
});
window.addEventListener('mousemove', (ev) => {
  if (!isPanning) return;
  const dx = ev.clientX - startX, dy = ev.clientY - startY;
  startX = ev.clientX; startY = ev.clientY;
  panX += dx; panY += dy;
  updateTransform(); updateLabels();
});
window.addEventListener('mouseup', () => { isPanning = false; });

canvas.addEventListener('wheel', (ev) => {
  ev.preventDefault();
  const rect = canvas.getBoundingClientRect();
  const mx = ev.clientX - rect.left;
  const my = ev.clientY - rect.top;
  const delta = -ev.deltaY;
  const factor = Math.exp(delta * 0.0018);
  const prevScale = scale;
  scale = Math.max(0.05, Math.min(20, scale * factor));
  panX = mx - (mx - panX) * (scale / prevScale);
  panY = my - (my - panY) * (scale / prevScale);
  updateTransform(); updateLabels();
}, { passive: false });

canvas.addEventListener('dblclick', () => {
  scale = 1.0; panX = 0; panY = 0; updateTransform(); updateLabels();
});

renderCells();
</script>
